import React, { useState, useEffect } from 'react';

function MyComponent() {
  const [tutors, setTutors] = useState([]);
  const [selectedTutor, setSelectedTutor] = useState('');

  useEffect(() => {
    fetch('https://example.com/api/tutors')
      .then(response => response.json())
      .then(data => setTutors(data));
  }, []);

  const handleSelectChange = event => {
    setSelectedTutor(event.target.value);
  };

  return (
    <div>
      <label htmlFor="tutor-select">Choose a tutor:</label>
      <select id="tutor-select" value={selectedTutor} onChange={handleSelectChange}>
        <option value="">Select a tutor</option>
        {tutors.map(tutor => (
          <option key={tutor.id} value={tutor.id}>
            {tutor.name}
          </option>
        ))}
      </select>
      {selectedTutor && <p>You selected {tutors.find(tutor => tutor.id === selectedTutor).name}</p>}
    </div>
  );
}

export default MyComponent;
